:host { --toolbar-item-gap: calc(
        (var(--design-unit) + calc(var(--density) + 2)) * 1px
      ); background-color: var(--fill-color); border-radius: calc(var(--control-corner-radius) * 1px); fill: currentcolor; padding: var(--toolbar-item-gap); }

.control { background: transparent; height: inherit; flex-grow: 1; box-sizing: border-box; display: inline-flex; justify-content: center; align-items: center; padding: 0
      max(
        1px,
        calc((10 + (var(--design-unit) * 2 * (var(--density) + var(--element-scale))))) * 1px
      ); white-space: nowrap; outline: none; text-decoration: none; border: calc(var(--stroke-width) * 1px) solid transparent; color: inherit; border-radius: inherit; fill: inherit; cursor: inherit; font-family: inherit; font-size: inherit; line-height: inherit; }

:host(.nested) .content-region { position: relative; margin-inline-start: calc(
        (
            (((var(--base-height-multiplier) + var(--density)) * 0.5 + 2) * var(--design-unit)) +
              ((var(--base-height-multiplier) + var(--density)) * 1.25)
          ) * 1px
      ); }

:host(.nested) .expand-collapse-button { left: var(
      --expand-collapse-button-nested-width,
      calc(
        (
            (((var(--base-height-multiplier) + var(--density)) * 0.5 + 2) * var(--design-unit)) +
              ((var(--base-height-multiplier) + var(--density)) * 1.25)
          ) * -1px
      )
    ); }
